itles.idCategories = tbl.id AND categoryTitles.idLanguages = %LANGUAGE_ID% LEFT JOIN categoryTitles AS alternateCategoryTitles ON alternateCategoryTitles.idCategories = tbl.id AND alternateCategoryTitles.idLanguages = 2, categories AS rootCat WHERE rootCat.id = 644 AND tbl.idRootCategory = rootCat.idRootCategory AND tbl.lft BETWEEN ( rootCat.lft +1 ) AND rootCat.rgt ORDER BY tbl.lft, categoryTitles.title');
